import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <div>Course Booking App</div>
            <ul>
                <li>Home</li>
                <li>Create Course</li>
                <li>Enroll</li>
            </ul>
        </nav>
    )
}

export default Navbar;
